import React from "react";

import Navbar from "./home/Navbar";
import Cara from "./home/Carsoel";
import ReactDom from "react-dom";

const Root = () => {
  return (
    <div>
      <Navbar />
      <Cara />
    </div>
  );
};

ReactDom.render(<Root />, document.querySelector("#root"));
